import numpy as np
import matplotlib.pyplot as plt

h = 0.02
delta_t = 0.001

a = 0.00028
b = 0.005
tau = 0.1
kappa = -0.005
const = (a/(h**2))
const1 = (b/(h**2))
const2 = delta_t/tau

#Creamos los arreglos de t, x, y donde se solucionará el problema
x = np.arange(0, 1, h)
y = np.arange(0, 1, h)
t = np.arange(0, 10, delta_t)
len_x = len(x)
len_y = len(y)
len_t = len(t)

#Creamos las matrices de solución para phi y psi
Psi_sol = np.zeros([len_t, len_x, len_y])
Phi_sol = np.zeros([len_t, len_x, len_y])

#Condiciones iniciales para t=0
#np.random.seed(1)
def RandomInitialConditions(array_sol, pos_x, pos_y):
  for i in range(len(pos_x)):
    for j in range(len(pos_y)):
      array_sol[0][i][j] = np.random.random()

  return array_sol

#Inicializamos las soluciones
Psi_sol = RandomInitialConditions(Psi_sol, x, y)
Phi_sol = RandomInitialConditions(Phi_sol, x, y)

for t in range(len_t-1):
  if t > 0:
    Phi_sol[t, 0, :] = Phi_sol[t, 1, :]
    Phi_sol[t, -1, :] = Phi_sol[t, -2, :]
    Phi_sol[t, :, 0] = Phi_sol[t, :, 1]
    Phi_sol[t, :, -1] = Phi_sol[t, :, -2]

    Psi_sol[t, 0, :] = Psi_sol[t, 1, :]
    Psi_sol[t, -1, :] = Psi_sol[t, -2, :]
    Psi_sol[t, :, 0] = Psi_sol[t, :, 1]
    Psi_sol[t, :, -1] = Psi_sol[t, :, -2]

  for i in range(1, len_x - 1):
    for j in range(1, len_y - 1):
      Phi_sol[t+1][i][j] = Phi_sol[t][i][j] + delta_t*(const*(Phi_sol[t][i+1][j] + Phi_sol[t][i-1][j] + Phi_sol[t][i][j+1] + Phi_sol[t][i][j-1] - 4*(Phi_sol[t][i][j])) + Phi_sol[t][i][j] - pow(Phi_sol[t][i][j], 3) - Psi_sol[t][i][j] + kappa)
      Psi_sol[t+1][i][j] = Psi_sol[t][i][j] + const2*(const1*(Psi_sol[t][i+1][j] + Psi_sol[t][i-1][j] + Psi_sol[t][i][j+1] + Psi_sol[t][i][j-1] - 4*(Psi_sol[t][i][j])) + (Phi_sol[t][i][j]) - (Psi_sol[t][i][j]))

"""![image.png](data:image/png;base64,)"""

#Crear una figura y ejes
fig, axs = plt.subplots(2, 3, figsize=(12, 8))


#Puedes realizar gráficos individuales en cada subfigura

axs[0, 0].imshow(Psi_sol[0*1000, :], interpolation='bilinear')
axs[0, 0].set_title(f'Tiempo {0}s')
axs[0, 1].imshow(Psi_sol[2*1000, :], interpolation='bilinear')
axs[0, 1].set_title(f'Tiempo {2}s')
axs[0, 2].imshow(Psi_sol[4*1000, :], interpolation='bilinear')
axs[0, 2].set_title(f'Tiempo {4}s')
axs[1, 0].imshow(Psi_sol[6*1000, :], interpolation='bilinear')
axs[1, 0].set_title(f'Tiempo {6}s')
axs[1, 1].imshow(Psi_sol[8*1000, :], interpolation='bilinear')
axs[1, 1].set_title(f'Tiempo {8}s')
axs[1, 2].imshow(Psi_sol[9998, :], interpolation='bilinear')
axs[1, 2].set_title(f'Tiempo {10}s')
plt.tight_layout()

# Mostrar el gráfico
plt.show()

"""Se llega a un patrón estacionario. Probablemente debido a que el término no lineal se resta. Si se suma, la solución rápidamente diverge. También es debido a la selección particular de coeficientes. Este es un análisis muy básico, simplemente comentando algunas cosas que pude observar al cambiar ciertos valores."""